import React, { Component} from 'react'

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      latitude: null,
      longitude: null,
    }
  }

  position = async () => {
    await navigator.geolocation.getCurrentPosition(
      position => this.setState({ 
        latitude: position.coords.latitude, 
        longitude: position.coords.longitude
      }),
      err => console.log(err)
    );
    //console.log(this.state.latitude)
  }

  render() {
    console.log(this.state.latitude+" "+this.state.longitude)
    var links = "https"+":"+"//"+"www"+"."+"google.com/maps/search/?api=1&query="+this.state.latitude+","+this.state.longitude

    return (
      <div>
        <button onClick={this.position} className='Filter'>Filter</button>
        <Text onClick={window.open(links)}>GOOGLE MAPS</Text>
      </div>
    );
  }
}

export default App;
